// components/Navbar.js
import React, { useState, useEffect } from "react";
import { Link } from 'react-router-dom';
import "../css/global.css";

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => setMenuOpen(!menuOpen);

  useEffect(() => {
    const handleClickOutside = (e) => {
      if (!e.target.closest('.nav-container')) setMenuOpen(false);
    };
    document.addEventListener('click', handleClickOutside);
    return () => document.removeEventListener('click', handleClickOutside);
  }, []);

  return (
    <header>
      <div className="nav-container">
        <div className="logo">
          <div className="logo-circle">
            <div className="logo-inner-circle"></div>
          </div>
          Celtical
        </div>
        <ul className={`nav-links ${menuOpen ? "active" : ""}`}>
          <li><Link to="/profile">Profile</Link></li>
          <li><Link to="/" className="current">Home</Link></li>
          <li><a href="#">Service</a></li>
          <li><Link to="/bookings">Book Now</Link></li>
          <li><Link to="/MyBookings" onClick={toggleMenu}>MyBookings</Link></li>
          <li><a href="#">Offers</a></li>
          <li><a href="#">Contact</a></li>
        </ul>

        <Link to="/HomePage" className="user-icon">
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24">
            <path stroke="none" d="M0 0h24v24H0z" fill="none"/>
            <path d="M12 2a5 5 0 1 1 -5 5l.005 -.217a5 5 0 0 1 4.995 -4.783z" />
            <path d="M14 14a5 5 0 0 1 5 5v1a2 2 0 0 1 -2 2h-10a2 2 0 0 1 -2 -2v-1a5 5 0 0 1 5 -5h4z" />
          </svg>
          <span>Login / Register</span>
        </Link>

        <div className="menu-toggle" onClick={toggleMenu}>
          <span></span>
          <span></span>
          <span></span>
        </div>
      </div>
    </header>
  );
};

export default Navbar;
